MICROFILM COLLECTION OF PUBLICATIONS OF WILHELM REICH, M.D.
An outright gift by Eva Reich M.D.

Microfilm Collection of seven (7) 35MM reels
The film matrix (unperforated) is approx. 1-3/8 inch wide which enables easy reading using a hand-held magnifier of four power [&quot;4X&quot;] or greater [10X may be preferable). Original silver-base masters produced 1957 by Eva Reich Moise, M.D.at Rangeley, Maine with assistance of William Moise. Film processed at General Microfilm Company, Cambridge, Mass. Diazo duplicates produced at Mark Larwood Company, Redwood City, California (operation sponsored by the Reich Orgone Archive).
Compiler and Project Consultant: Eva Reich M.D.
Production Co-ordinator: Harold Treacy
San Francisco, Reich Archive West, 1973


